import React, { Fragment, useContext } from 'react'
import ProfileContext from '../../contexts/profile/profileContext';

const EditInterests = ({ interests_list }) => {
    const  profileContext = useContext(ProfileContext);
    const { profile } = profileContext;
    const selectedInterests = profile.data.interests;
    console.log(selectedInterests[0]);
    const interest = [];
    for(const key in interests_list){

        interest.push(<input className="btn-light btn-sm" type="button" key={key} value={interests_list[key].interest}/>);
    }
    return (
        <Fragment>{interest}</Fragment>
    )
}

export default EditInterests
